(11, 'Lorem Ipsum', '<h2 style=\"margin: 0px 0px 10px; padding: 0px; font-weight: 400; line-height: 24px; font-family: DauphinPlain; font-size: 24px;\">What is Lorem Ipsum?</h2>\r\n<p style=\"margin: 0px 0px 15px; padding: 0px; text-align: justify; font-family: \'Open Sans\', Arial, sans-serif;\"><strong style=\"margin: 0px; padding: 0px;\">Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, <!--more-->but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '2018-11-24'),
(12, 'Kancil dan Harimau', '<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">aku seorang kapitan, terjadilah kelaparan di sebuah pulau yang penduduknya kebanyakan di huni oleh para Harimau. Mereka sangat kelaparan, karena semakin hari tidak ada hewan yang dapat mereka mangsa. Akhirnya, Raja Harimau mengutus Panglima dan para Prajuritnya untuk pergi ke pulau kecil di sebrang dan kembali dengan membawa banyak makanan.<!--more--></p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Perjalanan ke pulau kecil di sebrang cukup jauh. Akhirnya, mereka pun sampai di tempat tujuan. Di sana mereka sangat takjub dengan melihat keindahan alam pulang kecil tersebut. Namun, setibanya mereka disana. Mereka hanya melihat seekor Kancil kecil di tepi pantai. Kancil pun segera berlari. Namun, ia terlambat. Ia sudah di kepung oleh para Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Hei Kancil! Di mana Rajamu? Kami datang untuk meminta makanan. Jika kalian menolak, kami akan menyerang pulau kecil ini. Dan lihatlah, kami membawa potongan kumis raja kami.&rsquo;&rsquo; Kata prajurit Harimau dan menunjukkan kumis rajanya.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Kumis ini besar sekali. Pasti raja Harimau sangat besar dan kuat. Aku akan membawa kumis raja Harimau dan menunjukkannya kepada raja kami.&rsquo;&rsquo; Kata Kancil.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Sebenarnya, Kancil sangat kebingungan karena di pulau kecil tersebut tidak terdapat seorang Raja. Pada saat itu, Kancil melihat sahabatnya seekor Landak yang sangat besar. Ia pun langsung menemukan sebuah ide.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Hei sahabatku. Kemarilah, aku sangat membutuhkan bantuanmu!&rsquo;&rsquo; kata Kancil.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Hah? Bantuanku? Buat apa Cil?&rsquo;&rsquo; Tanya Landak.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Untuk keselamatan semua hewan di pulau ini.&rsquo;&rsquo; Jawab Kancil.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Akhirnya, Landak pun mencabut durinya yang paling besar, rajam dan panjang. Setelah mendapatkan duri tersebut. Kancil langsung berlari membawa duri Landak dan menyerahkan kepada para Harimau. Kancil pun mencari di mana para Harimau itu. Akhirnya, Kancil berhasil menemukan mereka di tepi pantai. Mereka tertidur sangat pulas. Kancil pun membangunkan panglima Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Tuan, raja kami siap untuk berperang. Sebagai buktinya. Raja kami pun mengirimkan kumisnya.&rsquo;&rsquo; Kata Kancil tegas. Ia pun langsung menyerahkan kumis Landak kepada para Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Ini kumis raja mu?&rsquo;&rsquo; Tanya panglima Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Iya, itu adalah kumis raja kami yang paling kecil. Raja kami pun menerima tantangan dari raja kalian.&rsquo;&rsquo; Kata Kancil.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Para Harimau pun sangat terkejut melihat kumis raja pulau kecil yang besar dan tajam.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Kumis raja Kancil sangat besar. Sangat besar dari kumis raja kita. Kita pasti akan sulit untuk melawannya.&rsquo;&rsquo; Bisik panglima Harimau kepada para prajuritnya.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Lalu bagaimana?&rdquo; Tanya salah satu Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">&lsquo;&rsquo; Sebaiknya kita segera pergi dari pulau ini.&rsquo;&rsquo; Jawab panglima Harimau.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Akhirnya, para Harimau pergi meninggalkan pulau kecil tersebut. mereka pun melanjutkan perjalanan ke pulau lainnya untuk mencari makanan.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; line-height: 27px; color: #4c4c4c; font-family: \'Open Sans\', sans-serif; font-size: 15px;\">Sejak saat itu, tidak ada satu Harimau pun yang berani datang ke pulau kecil. Semua itu berkat kecerdikan Kancil dan kecerdikkannya.</p>', '2018-11-24'),
